import Box from "@mui/material/Box";
import {AppBar, Button, IconButton, List, ListItem, ListItemText, Toolbar, Typography} from "@mui/material";
import * as React from "react";
import Grid from "@mui/material/Grid";
import example from "../example.json";

function NavBar(){
    return(
        <Box sx={{ flexGrow: 1 }}>
            <AppBar position="static">
                <Toolbar>
                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        sx={{ mr: 2 }}
                    >
                    </IconButton>
                    <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                        News List
                    </Typography>
                    <Button color="inherit" style={{fontWeight: 'bold', fontSize: '20px'}}>‚Üê</Button>
                </Toolbar>
            </AppBar>

        </Box>
    );
}

function CommentIcon() {
    return null;
}

function GutterlessList() {
    return (
        <List sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}>
            {[1, 2, 3].map((value) => (
                <ListItem
                    key={value}
                    disableGutters
                    secondaryAction={
                        <IconButton>
                            <CommentIcon />
                        </IconButton>
                    }
                >
                    <ListItemText primary={`Line item ${value}`} />
                </ListItem>
            ))}
        </List>
    );
}

function getStaticProps(){
    const data =  JSON.parse(JSON.stringify(example));
    return data;
}

export default function NewsList() {
    const data = getStaticProps();
    return (
        <>
            <NavBar/>
            <GutterlessList/>
        </>
    );
}
